    }
    render(){
        return(
            <div>
                <form>
                    <label> Your Name : &nbsp;
                        <input type="text" value={this.state.Username}/>
                    </label>

    <br/>

                    <label> Passcode : &nbsp;
                        <input type="password" value={this.state.Password}/>
                    </label>

    <br/>

                    <button>SUBMIT HERE</button>
                </form>
            </div>
        )
    }
}

export default Formcls
